import React, { useEffect, useState } from 'react'

const Products = () => {

const [product,setproduct] = useState([])    

useEffect(()=>{
    fetch('https://fakestoreapi.com/products')
           .then(data => data.json())
           .then(result=>setproduct(result))
})

  return (
    <div>
        {JSON.stringify(Products)}
    </div>
  )
}

export default Products
